import React, { Component } from "react";
import {
  View,
  Text,
  StyleSheet,
  SafeAreaView,
  TextInput,
  Platform,
  StatusBar,
  ScrollView,
  Image,
  Dimensions,
} from "react-native";
import Home from "./home";
const { height, width } = Dimensions.get("window");

export default class cat extends Component {
  render() {
    return (
      <View
        style={{
          paddingHorizontal: 20,
          marginTop: 20,
          flexDirection: "row",
          flexWrap: "wrap",
          justifyContent: "space-between",
        }}
      >
        <Home
          width={width}
          name="The Cozy Place"
          type="PRIVATE ROOM - 2 BEDS"
          price={82}
          rating={4}
